import React, { useEffect, useState } from 'react'

const Logout = () => {

    // promises

    useEffect(() => {
        fetch('/logout', {
            method:"GET",
            headers: {
                Accept: "application/json",
                "Content-Type":"application/json"
            },
            credentials:"include"
        });
    });

  return (
    <>
      <h1>Logout Page</h1>
    </>
  )
}

export default Logout
